import React, { useState, useEffect } from "react";
import { useNavigate } from "react-router-dom";
import { 
  Card, 
  CardContent, 
  CardDescription, 
  CardHeader, 
  CardTitle 
} from "../components/ui/card";
import { Button } from "../components/ui/button";
import DomainForm from "../components/DomainForm";
import { useToast } from "../hooks/useToast";
import { Alert, AlertDescription, AlertTitle } from "../components/ui/alert";
import { InfoIcon } from "lucide-react";
import { DEFAULT_CONFIG } from "../utils/constants";

const Domain = () => {
  const [loading, setLoading] = useState(true);
  const [config, setConfig] = useState(null);
  const [error, setError] = useState(null);
  const { toast } = useToast();
  const navigate = useNavigate();

  useEffect(() => {
    setLoading(true);
    try {
      const savedConfig = localStorage.getItem("wrf_config");
      if (savedConfig) {
        const parsedConfig = JSON.parse(savedConfig);
        setConfig(parsedConfig);
      } else {
        setConfig(DEFAULT_CONFIG);
      }
    } catch (err) {
      console.error("Error loading configuration:", err);
      setError("加载配置时出错，请刷新页面重试");
      setConfig(DEFAULT_CONFIG);
    } finally {
      setLoading(false);
    }
  }, []);

  const handleSubmit = (domainData) => {
    try {
      const updatedConfig = {
        ...(config || DEFAULT_CONFIG),
        domain: domainData
      };

      localStorage.setItem("wrf_config", JSON.stringify(updatedConfig));
      setConfig(updatedConfig);

      toast({
        title: "域配置已保存",
        description: "您的WRF域设置已成功保存",
      });
    } catch (err) {
      console.error("Error saving domain configuration:", err);
      toast({
        title: "保存失败",
        description: "保存域配置时出错，请重试",
        variant: "destructive",
      });
    }
  };

  const goBack = () => {
    navigate("/time");
  };

  const goNext = () => {
    navigate("/physics");
  };

  if (loading) {
    return (
      <div className="container mx-auto max-w-7xl p-6">
        <div className="flex justify-center items-center h-[60vh]">
          <p className="text-lg text-muted-foreground">正在加载域配置...</p>
        </div>
      </div>
    );
  }

  if (error) {
    return (
      <div className="container mx-auto max-w-7xl p-6">
        <Alert variant="destructive" className="mb-6">
          <InfoIcon className="h-4 w-4" />
          <AlertTitle>配置加载错误</AlertTitle>
          <AlertDescription>{error}</AlertDescription>
        </Alert>
        <div className="flex justify-between mt-6">
          <Button onClick={goBack} variant="outline">
            返回
          </Button>
        </div>
      </div>
    );
  }

  return (
    <div className="container mx-auto max-w-7xl p-6">
      <h1 className="text-3xl font-bold mb-2">WRF域配置</h1>
      <p className="text-muted-foreground mb-6">
        配置WRF模拟的空间域参数，包括地图投影、网格设置和嵌套域
      </p>

      <Alert className="mb-6">
        <InfoIcon className="h-4 w-4" />
        <AlertTitle>关于域配置</AlertTitle>
        <AlertDescription>
          域配置决定了您的WRF模拟的地理覆盖范围和网格分辨率。合理的域设置对于获得准确的模拟结果至关重要。
        </AlertDescription>
      </Alert>

      <DomainForm 
        onSubmit={handleSubmit} 
        defaultValues={config?.domain || DEFAULT_CONFIG.domain}
      />

      <div className="flex justify-between mt-6">
        <Button onClick={goBack} variant="outline">
          返回时间设置
        </Button>
        <Button 
          onClick={goNext} 
          disabled={!config?.domain}
        >
          继续物理参数设置
        </Button>
      </div>
    </div>
  );
};

export default Domain;
